// src/App.js
import React, { Component } from "react";

class TotalTimer extends Component {
  render() {
    return (
      <div className="">
        <h1>Stopwatch</h1>
        <Stopwatch />
      </div>
    );
  }
}

class Stopwatch extends Component {
  states = {
    status: false,
    runningTime: 0
  };
  render() {
    const { status, runningTime } = this.state;
    return (
      <div>
        <p>{runningTime}ms</p>
        <button>{status ? "Stop" : "Start"}</button>
        <button>Reset</button>
      </div>
    );
  }
}

export default TotalTimer;
